    corrected and the required notice was mailed to him.  With regard to the Committee''s
    best efforts, the Committee includes a request for a contributor''s name, address,
    occupation and employer as required by federal law in every solicitation it does.  If
    a contribution is received without it, a written request for the information is
    sent within 30 days, along with a pre-addressed return envelope.  Any contributor
